import React, { useEffect } from "react";
import { Navigate, useNavigate } from "react-router-dom";

function NotFound() {
  const navigate = useNavigate();

  useEffect(() => {
    setTimeout(() => {
      navigate("/");
    }, 1000);
  }, []);

  return (
    <>
      <h1>Not Found</h1>
    </>
  );
}

export default NotFound;
